import React from "react";
import { View, Text } from "react-native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { AppColor } from "../utils/StyleConstants";
import Icon from 'react-native-elements';

import PendingScreen from "../models/pending-screen/PendingScreen";
import CompletedScreen from "../models/completed-screen/CompletedScreen";
import OverdueScreen from "../models/overdue-screen/OverdueScreen";

const MainTabNavigation = () => {
  const Tab = createBottomTabNavigator();
  return (
    <Tab.Navigator
      screenOptions={{
        headerShadowVisible: false,
        tabBarActiveTintColor: AppColor.primary,
        tabBarInactiveTintCOlor: AppColor.textDisabled,
        headerTintColor: AppColor.primary,
      }}
    >
      <Tab.Screen name="PendingScreen" component={PendingScreen} options={{ title: "Pending", tabBarIcon}} />
      <Tab.Screen name="CompletedScreen" component={CompletedScreen} />
      <Tab.Screen name="OverdueScreen" component={OverdueScreen} />
    </Tab.Navigator>
  );
};

export default MainTabNavigation;
